import React, { useEffect, useState } from "react";

const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/todos1").then((data) => {
      data.json().then((result) => {
        console.log("result", result);
        setUser(result.data);
      });
    });
  }, []);
  return (
    <>
      <table>
        <tr>
          <th>{user.data.id}</th>
          </tr>
      </table>
    </>
  );
};

export default Api;
